import { Box, Tooltip } from "@chakra-ui/react";


function Toppart(){
   return (
     <Box
       h="px"
       d="flex"
       justifyContent="space-between"
       alignItems="center"
       bg="white"
       w="100%"
       p="5px 10px 5px 10px"
       borderWidth="5px"
     >
       <Tooltip label="Search the users">SearchIcon</Tooltip>
     </Box>
   );
}

export default Toppart;
